        [Fact]
        public void ConversionRoundTrip()
        {
            Irradiation joulepersquaremeter = Irradiation.FromJoulesPerSquareMeter(1);
            AssertEx.EqualTolerance(1, Irradiation.FromCentijoulesPerSquareCentimeter(joulepersquaremeter.CentijoulesPerSquareCentimeter).JoulesPerSquareMeter, CentijoulesPerSquareCentimeterTolerance);
            AssertEx.EqualTolerance(1, Irradiation.FromCentijoulesPerSquareMeter(joulepersquaremeter.CentijoulesPerSquareMeter).JoulesPerSquareMeter, CentijoulesPerSquareMeterTolerance);
            AssertEx.EqualTolerance(1, Irradiation.FromCentijoulesPerSquareMillimeter(joulepersquaremeter.CentijoulesPerSquareMillimeter).JoulesPerSquareMeter, CentijoulesPerSquareMillimeterTolerance);
            AssertEx.EqualTolerance(1, Irradiation.FromCentiwattHoursPerSquareMeter(joulepersquaremeter.CentiwattHoursPerSquareMeter).JoulesPerSquareMeter, CentiwattHoursPerSquareMeterTolerance);
            AssertEx.EqualTolerance(1, Irradiation.FromDecajoulesPerSquareCentimeter(joulepersquaremeter.DecajoulesPerSquareCentimeter).JoulesPerSquareMeter, DecajoulesPerSquareCentimeterTolerance);
            AssertEx.EqualTolerance(1, Irradiation.FromDecajoulesPerSquareMeter(joulepersquaremeter.DecajoulesPerSquareMeter).JoulesPerSquareMeter, DecajoulesPerSquareMeterTolerance);
            AssertEx.EqualTolerance(1, Irradiation.FromDecajoulesPerSquareMillimeter(joulepersquaremeter.DecajoulesPerSquareMillimeter).JoulesPerSquareMeter, DecajoulesPerSquareMillimeterTolerance);
            AssertEx.EqualTolerance(1, Irradiation.FromDecawattHoursPerSquareMeter(joulepersquaremeter.DecawattHoursPerSquareMeter).JoulesPerSquareMeter, DecawattHoursPerSquareMeterTolerance);
            AssertEx.EqualTolerance(1, Irradiation.FromDecijoulesPerSquareCentimeter(joulepersquaremeter.DecijoulesPerSquareCentimeter).JoulesPerSquareMeter, DecijoulesPerSquareCentimeterTolerance);
